textOriginal:
1. Alegaram que o mito teve 154 mil inserções a menos em rádios do nordeste;
2. Xandão pediu provas, já que a fiscalização cabe aos partidos;
3. Apresentam uma pequena amostra de áudios, com links quebrados, rádios que já fecharam, rádio da família do Fábio Faria e outras que nem receberam a peça da campanha;
5. Constatou-se que a ferramenta usada para medir as inserções era imprecisa. Em alguns casos, teve até mais inserções do Bolsonaro do que deveria ter;
6. Xandão acertadamente nega ação sobre rádios por falta de provas;
CONCLUSÃO: Choro de perdedor.
